// export default Contact
import React, { useState } from 'react';
import { ToastContainer, toast } from 'react-toastify';
import axios from 'axios';
import 'react-toastify/dist/ReactToastify.css';
import './Contact.css'; // Import CSS for background styling

const Contact = () => {
    const notify = () => {
        toast.success('Form submitted successfully');
    };

    const [user, setUser] = useState({ email: '', name: '', message: '' });

    const on_Change = (e) => {
        setUser((prevUser) => ({
            ...prevUser,
            [e.target.name]: e.target.value,
        }));
    };

    const onSubmit_ = async (e) => {
        e.preventDefault();
        try {
            if (user.email && user.name && user.message) {
                await axios.post('http://localhost:5000/contactUser', user);
                setUser({ email: '', name: '', message: '' });
                notify();
            } else {
                toast.error('Please fill in all fields');
            }
        } catch (error) {
            console.error('Error submitting form', error);
            toast.error('Submission failed');
        }
    };

    return (
        <>
            {/* Video Background */}
            <div className="video-container">
                <video autoPlay loop muted>
                    <source src="/background.mp4" type="video/mp4" />
                    Your browser does not support the video tag.
                </video>
            </div>

            {/* Contact Form */}
            <div className="container d-flex justify-content-center align-items-center vh-100">
                <div className="col-md-6 col-lg-5 bg-light p-4 rounded shadow form-container">
                    <h2 className="text-center mb-3">Contact Form</h2>
                    <form onSubmit={onSubmit_}>
                        <div className="form-group">
                            <label>Email Address</label>
                            <input
                                type="email"
                                name="email"
                                className="form-control"
                                placeholder="Enter your email"
                                value={user.email}
                                onChange={on_Change}
                            />
                        </div>
                        <div className="form-group mt-2">
                            <label>Name</label>
                            <input
                                type="text"
                                name="name"
                                className="form-control"
                                placeholder="Enter your name"
                                value={user.name}
                                onChange={on_Change}
                            />
                        </div>
                        <div className="form-group mt-3">
                            <label>Message</label>
                            <textarea
                                name="message"
                                className="form-control"
                                placeholder="Enter your message"
                                rows="5"
                                value={user.message}
                                onChange={on_Change}
                            ></textarea>
                        </div>
                        <button type="submit" className="btn btn-primary w-100 mt-3">
                            Submit
                        </button>
                    </form>
                </div>
            </div>

            <ToastContainer />
        </>
    );
};

export default Contact;
